import React, {useState, useEffect} from 'react';
import axios from 'axios';
import './App.css';
import PhotoGrid from './Components/UI/PhotoGrid';
import Header from './Components/UI/Header';


const App = () => {
  const [imageList, setImageList] = useState([]);
  const [newImageList, setNewImageList] = useState([]);
  const API_KEY = '4fdxFtNkZwq8H36afmKh1ImHEnzcQG95nAN9W28e';
  const COUNT_VAL = 100;

  useEffect(() => {
    const fetchData = async () => {

      const response = await axios(
        `https://api.nasa.gov/planetary/apod?count=${COUNT_VAL}&thumbs=true&concept_tags=True&api_key=${API_KEY}`
      )

      console.log(response.data)

      setImageList(response.data)
    }

    fetchData()

  }, [])

  const loadMoreData = async () => {

    const response1 = await axios(
      `https://api.nasa.gov/planetary/apod?count=${COUNT_VAL}&thumbs=true&concept_tags=True&api_key=${API_KEY}`
    )

    console.log(response1.data)

    setNewImageList(response1.data)
  }

  return (
    <div  className="container">
      <Header/>
      <PhotoGrid images={imageList} />
      <div className='footer'>
        <button className="LoadButton" onClick={loadMoreData}>Load More...</button>
      </div>
    </div>
  );
}

export default App;
